import React, { useState, useEffect, useRef } from 'react';
import { SearchBox } from 'components/search-box/search-box';
import Router,{ useRouter } from 'next/router';
import {SearchWrapper, SearchResultWrap} from './humidity-logs-graph.style';
import { IHumidityLogs } from 'utils/types';
import LineChart from 'components/line-chart/line-chart';

interface Props {
  data?: IHumidityLogs;
}

const HumidityLogsGraph: React.FC<Props> = ({ data, ...props  }) => {
  console.log(data)
  JSON.stringify(data)
  let humidities = [];
  let times = [];
  Object.keys(data).forEach(function (key, index) {
    humidities.push(data[key].humidity);
    times.push(data[key].timestamp);

});
  return (
    <SearchWrapper>
      <LineChart
        widgetTitle='Watering history'
        color={['#03D3B5']}
        opctions={[1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998, 1999]}
        seriesName='Unique visitors'
        series={[{
          name: 'series-1',
          data: [humidities]
        }]}
      />
    </SearchWrapper>
  );
};

export default HumidityLogsGraph;
